import { Injectable } from '@angular/core';
import { Observable, Subject } from 'rxjs';
import { HttpClient, HttpHeaders, HttpResponse } from '@angular/common/http';
import { environment } from '../../environments/environment';

const apiUrl = environment.apiUrl;

@Injectable({
  providedIn: 'root'
})
export class LoginService {
  private logged = new Subject<any>();

  constructor(
    private http: HttpClient
  ) { }

  setSessionStatus(logged) {
    this.logged.next(logged);
  }

  getSessionStatus(): Observable<any> {
    return this.logged.asObservable();
  }

  logIn(username, password) {
    const apiURL = `${apiUrl}login`;
    const httpOptions = {
        headers: new HttpHeaders({ 'Content-Type': 'application/json' }),
        observe: 'response' as 'body'
    };
    const body = {
      usuario: username,
      password
    };
    this.http.post(apiURL, body, httpOptions)
      .subscribe((data: HttpResponse<any>) => {
          const token = data.headers.get('authorization');
          localStorage.setItem('token', token);
          this.setSessionStatus(true);
      }, error => {
        this.setSessionStatus(false);
        console.log('Error', error);
      });
  }

  logOut() {
    const apiURL = `${apiUrl}logout`;
    const token = localStorage.getItem('token');
    const httpOptions = {
        headers: new HttpHeaders({ Authorization: token })
    };

    this.http.post(apiURL, {}, httpOptions)
      .subscribe((data: HttpResponse<any>) => {
        localStorage.clear();
        this.setSessionStatus(false);
      }, error => {
        console.log('Error', error);
      });
  }
}

