import { NgForm } from '@angular/forms';
import { Router } from '@angular/router';
import { LoginService } from '../services/login.service';

@Component({
    selector: 'app-login',
    templateUrl: './login.component.html',
    styleUrls: ['./login.component.scss']
})
export class LoginComponent implements OnInit {
    constructor(
        private router: Router,
        private loginService: LoginService
    ) {
        this.loginService.getSessionStatus().subscribe(logged => {
            this.logged = logged;
            this.isLoading = false;
            if (this.logged) {
                this.goToLogged();
            }
        });
    }

    public isLoading = false;
    public logged = false;

    ngOnInit() {
        const token = localStorage.getItem('token');
        this.logged = token ? true : false;
        this.loginService.setSessionStatus(this.logged);
    }

    public logOut() {
        this.loginService.logOut();
    }

    public async login(form: NgForm) {
        await this.loginService.logIn(form.value.username, form.value.password);
        this.isLoading = true;
        form.resetForm();
    }

    goToLogged() {
        this.router.navigateByUrl('onboarding');
    }

}

