    @Input() curp: any;
    @Input() diezHuellas: any;
    @Input() dosHuellas: any;
    @Input() ine: object;
    constructor() { }

    ngOnInit() {

    }

    getFingerprint(biometricType: string) {
        const found = this.diezHuellas
            .filter((h) => h.biometricType.toUpperCase() === biometricType.toUpperCase());
        return (found || {})[0].imageUrl;
