import { Component, OnInit, Input } from '@angular/core';

@Component({
  selector: 'app-stepper',
  templateUrl: './stepper.component.html',
  styleUrls: ['./stepper.component.scss']
})

export class StepperComponent implements OnInit {
  @Input() steps = [];
  @Input() actualStepId = '';

  constructor() { }

  ngOnInit() { }

  getClassPosition(index) {
    if (index === 0) {
      return 'end-left-step';
    } else if (index === this.steps.length - 1) {
      return 'end-right-step';
    }
    return 'step-squared';
  }

  getClassStatus(index) {
    const indexActualState = this.steps.findIndex(element => element.id === this.actualStepId);
    if (index < indexActualState) {
      return ' completed';
    } else if (index === indexActualState) {
      return ' is-active';
    }
    return '';
  }

  getClass(step) {
    let classString = '';
    const index = this.steps.indexOf(step);
    classString += this.getClassPosition(index);
    classString += this.getClassStatus(index);
    return classString;
  }
}

